Prisma ORM offers various queries to read data from your database. In this section, you'll use the findMany query that returns all the records in the database for a given model.

Delete the previous Prisma ORM query and add the new findMany query instead:

index.ts
import { prisma } from "./lib/prisma";
async function main() {
  const users = await prisma.user.findMany(); 
  console.log(users); 
}
main()
  .then(async () => {
    await prisma.$disconnect();
  })
  .catch(async (e) => {
    console.error(e);
    await prisma.$disconnect();
    process.exit(1);
  });

Execute the script again:

npx tsx index.ts
[{ id: 1, email: 'alice@prisma.io', name: 'Alice' }]

Notice how the single User object is now enclosed with square brackets in the console. That's because the findMany returned an array with a single object inside.

One of the main features of Prisma ORM is the ease of working with . In this section, you'll learn how to create a User and a Post record in a nested write query. Afterwards, you'll see how you can retrieve the relation from the database using the include option.

First, adjust your script to include the nested query:

index.ts
import { prisma } from "./lib/prisma";
async function main() {
  const user = await prisma.user.create({
    data: {
      name: "Bob", 
      email: "bob@prisma.io", 
      posts: {
        create: [
          {
            title: "Hello World", 
            published: true, 
          }, 
          {
            title: "My second post", 
            content: "This is still a draft", 
          }, 
        ], 
      }, 
    }, 
  }); 
  console.log(user); 
}
main()
  .then(async () => {
    await prisma.$disconnect();
  })
  .catch(async (e) => {
    console.error(e);
    await prisma.$disconnect();
    process.exit(1);
  });

Run the query by executing the script again:

npx tsx index.ts
{ id: 2, email: 'bob@prisma.io', name: 'Bob' }

In order to also retrieve the Post records that belong to a User, you can use the include option via the posts relation field:

index.ts
import { prisma } from "./lib/prisma";
async function main() {
  const usersWithPosts = await prisma.user.findMany({
    include: {
      posts: true, 
    }, 
  }); 
  console.dir(usersWithPosts, { depth: null }); 
}
main()
  .then(async () => {
    await prisma.$disconnect();
  })
  .catch(async (e) => {
    console.error(e);
    await prisma.$disconnect();
    process.exit(1);
  });

